import React from 'react'
import "../css/Banners.css"

const Banners = (props) => {
  return (
    <div className='banners'>
      <h1><img src={require("../media/script/Banners.png")} alt='about'></img></h1>
      <img src={require("../media/Banners/Banner 1.jpg")} alt='about'></img>
    </div>
  )
}


export default Banners;
